import React, { useEffect } from "react";

import { Line } from "react-chartjs-2";
function Charts() {
  const [chartData, setChartData] = useState({});

  const chart = () => {
    setChartData({
      labels: ["monday", "tuesday", "wednesday", "thursday", "friday"],
      datasets: [
        (label: "lvvel of thiccness"),
        (data: [32, 45, 12, 76, 69]),
        (backreoundColor: ["rgba(75, 192, 192, 0.6)"]),
        (borderWidth: 4),
      ],
    });
  };

  useEffect(() => {
    chart();
  }, []);

  return (
    <div>
      <Line data={chartData} />
    </div>
  );
}

export default Charts;
